import React from "react";
import { HomeState, initHomeState } from "./home.state";

export class Home extends React.Component<{},HomeState>{
    constructor(props: {}){
        super(props)//base class
        this.state = initHomeState 
    }

    render():JSX.Element{
        return (
           <div>
            Welcome to our home page!
                <div>
                    <button>
                        Registration Form
                    </button>
                </div>
                <div>
                    <button>
                        Overview
                    </button>
                </div>
           </div>
        )
    }
}
